import React, { Component } from 'react';
import Message from './Message.js'

class MessageList extends Component {

  render() {
    return (
      <div className="container">
        <div className="row">
          {(this.props.messages.length) ? this.props.messages.map((message, i) => {return <Message starMessage={this.props.starMessage} key={i} id={this.state.messages[i].id} subject={this.state.messages[i].subject} read={this.state.messages[i].read} starred={this.state.messages[i].starred} labels={this.state.messages[i].labels}/>}) : "No messages"}
        </div>
      </div>
    )
  }

}
export default MessageList;
